import React from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';
import login from './components/login'; // Import the About component

function ColorSchemesExample() {
  return (
    <>
      <Navbar bg="dark" variant="dark">
      <div className="logo">
      <img
        src="https://storage.googleapis.com/openscreenshot/7%2Fd%2FU/aR9OpPUd7.png"
        alt="Screenshot"
        style={{ float: 'left', width: '200px', height: 'auto', borderRadius: '15px' }}
      />
    </div>
        <Container>
          <Navbar.Brand href="#home"></Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Pricing</Nav.Link>
          </Nav>
          <Nav>
            <Nav.Link href="#login">Login</Nav.Link>
            <Button variant="outline-light" href="#singup">SignUp</Button>
          </Nav>
        </Container>
      </Navbar>
      <br />
      <br />
    </>
  );
}

export default ColorSchemesExample;
